sourcesContent:
fetch("https://api.partly.com/node-api/graphql", {
  method: "POST",
  headers: { '"Content-Type': "application/json" },
  body: JSON.stringify({
    query: `
    query {
      uvdb {
        search_uvdb_years {
          items {
            id
          }
        }
      }
    }
    `,
  }),
})
  .then((response) => response.json())
  .then((data) => {
    console.log(data.data);
  });

export const getApi = () => {
  fetch("https://api.partly.com/node-api/graphql", {
    method: "POST",
    headers: { '"Content-Type': "application/json" },
    body: JSON.stringify({
      query: `
    query {
      uvdb {
        search_uvdb_years {
          items {
            id
          }
        }
      }
    }
    `,
    }),
  })
    .then((response) => response.json())
    .then((data) => {
      console.log(data.data);
    });
};
